import React from 'react';
import styled from 'styled-components';

import card from '../assets/card.png'
import card2 from '../assets/card_cap.png'

import {H1, SmallContainer} from '../components'

const Style = styled.div`
	background-image: url(${card});

	background-size: cover;
	display: flex;
	flex-direction: column;
	justify-content: flex-start;
	position: relative;
	width: 360px;
	height: 130px;
	margin: 8px 0;
	transition: all 0.5s;
	box-shadow: 0px 0px 10px -2px rgba(200,200,200,0.2);
	border-bottom: 1px solid white;

	&:nth-child(odd) {
		align-self: flex-end;
		background-image: url(${card2});
	}

	img {

	}

	&:hover {
		box-shadow: 0px 0px 10px -2px rgba(255,255,255,0.5);

	}


`;

class Card extends React.Component {
	render() {
	return(
		<Style>
		<SmallContainer marginright='auto' marginleft='auto'>
			<H1 className='title'>IRON MAN</H1>
		</SmallContainer>

		<p>"I am Iron Man"</p>

		<SmallContainer marginleft='auto' marginright='10px' className='date'>
			<p>May 2008</p>
		</SmallContainer>

		</Style>
	)
	}
}

export default Card;
